import React from 'react';
import { Routes, Route } from 'react-router-dom';

const About = () => (
  <div>
    <h1>About Page</h1>
    <Routes>
      <Route path="team" element={<div>Team Information</div>} />
      <Route path="mission" element={<div>Our Mission</div>} />
    </Routes>
  </div>
);

export default About;
